                    alt=""
                />
            </div>
            <div>
                <img
                    src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSuRBFgBGO67Dxq9V-9vR3SsKBAhssT5hiqKsSFtK4jxuTkRxd1&usqp=CAU"
                    alt=""
                />
            </div>
            <div>My post</div>

            Main content
        </div>
    );
};

export default Content;
